import SumaEx from "./SumaEx"

const Course = ({ course }) => {
    console.log(course)
    return (<>
        <h1>{course.name}</h1>
        {course.parts.map(parte => (<p key={parte.id} >{parte.name} {parte.exercises}</p>))}
        <SumaEx course={course} />
    </>)
}
export default Course
